import React from 'react';
import {Card, OverlayTrigger, Button, Container, Row} from 'react-bootstrap'
import styles from './styles.css'


export default class Resources extends React.Component {
    constructor(props) {
        super(props);
    }


    render() {
        return (
            <div>

            <Card style={{width:250, height: 250}}className="bg-light text-white">
            <Card.Img src= {this.props.imgsrc} alt="Card image" />
            <Card.ImgOverlay>
                <Card.Title>{this.props.title}</Card.Title>
                    <Card.Text className='cardContent'>
                    {this.props.info}
                    </Card.Text>             
            </Card.ImgOverlay>
        </Card>
        </div>

        );
    }
}
